import React from 'react';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';
import { Typography } from 'antd';
import whiteLogo from '../../styles/images/whiteLogo.png'

const { Text } = Typography

const style = {
    main: {
        height: '100%',
        width: '100%',
        background: '#fff',
        display: 'flex',
        flexDirection: 'column'
    },
    sidebar: {
        height:'100%',
        width:'200px',
        background:'linear-gradient(90deg,#ff773b,#ff8e24 35%,#ff8e24)',
        display:'flex',
        flexDirection:'column',
        alignItems:'center'
    }
}

const Layout = (props) => {
    return (
        <main style={style.main}>
            <div style={style.sidebar}>
                <div style={{display:'flex', justifyContent:'center', width:'100%', borderBottom:'1px solid #fff'}}>
                    <img src={whiteLogo} style={{width:'120px', marginTop:'4px', marginBottom:'10px'}} alt="CNX Telecom - vocÃª sempre conectado!" />
                </div>
                <div>
                    <ul style={{listStyleType:'none'}}>
                        <li style={{height:'150px'}}>Teste</li>
                    </ul>
                </div>
                <div></div>
            </div>
        </main>
    )
}

export default Layout;
